import "../meio/meio.css";
import Conteudo from "./conteudo/conteudo";
import Topo from "./topo/topo";
import Janela from "./janela/janela";

function Meio() {
  return (
    <div className="meio">
      <Janela>
        <Conteudo />
      </Janela>
    </div>
  );
}

export default Meio;
